# https://leetcode.com/problems/minimum-time-to-finish-the-race/
from typing import List


class Solution:
    def minimumFinishTime(self, tires: List[List[int]], changeTime: int, numLaps: int) -> int:
        minimums = []
        totals = [0] * len(tires)
        for i in range(numLaps):
            for j, tire in enumerate(tires):
                totals[j] += tire[0] * (tire[1]**(i))
            minimums.append(min(totals))
            if minimums[-1] > minimums[0] + changeTime: break

        dp = [10**14] * numLaps
        for i in range(numLaps):
            for j in range(len(minimums)):
                if i - j - 1 < 0:
                    dp[i] = min(dp[i], minimums[j])
                    break
                dp[i] = min(dp[i], minimums[j] + changeTime + dp[i-j-1])

        return dp[-1]


